311 - Amber [promo].VOB 



Very HQ promo music video. &quot;Amber&quot; is a 2001 single from the band 311 
off their album From Chaos. Focusing more on their reggae roots, the song 
is about vocalist Nick Hexum's then fiance Nicole Scherzinger. Scherzinger 
appears briefly in the music video, playing in the ocean with Hexum. &quot;Amber&quot; 
peaked at #27 on the Adult Top 40 and #13 on Modern Rock Tracks.
(video does not have any logos)


